g2:c.PROCEDURE.g2:a.TEXT:
GET-CON-VERTICES-NO-COMPATIBILITY-TEST(node: class benchmark-node )
IL: class integer-list;
C: class connection;
item-not-connected: class tst-block;

cc-one-vertice, cc-two-vertices, cc-up, cc-down: class connection;
block-object: class tst-block-obj;
length, length-ref, el: integer;
vertices-list-ref: sequence = sequence(20, 30, 40, 50, 10);
vertices-ccdown-list: sequence = sequence(20, -30, 40, -50, 20, 30, 30);
vertices-list-one-vertice: sequence = sequence(-20);
vertices-list-two-vertices: sequence = sequence(20, 20);

err: class error;
err-hap: truth-value = false;
begin
    create an integer-list IL;
    create a tst-block item-not-connected;
    create a tst-block-obj block-object;
    change the name of IL to the symbol vertices-list;


    create a connection cc-up connected to my-instance-block newly locating it at right 15 with direction output, with vertices 20 30 40 50 10;

    create a connection cc-down connected to my-instance-block newly locating it at right 25 with direction output, with vertices 20 -30 40 -50 20 30 30;

    create a connection cc-one-vertice connected to one-list newly locating it at left 20 with direction output, with vertices -20;

    create a connection cc-two-vertices connected to one-list newly locating it at right 20 with direction output, with vertices 20 20;

    transfer item-not-connected to this workspace at (20, -50);
    transfer block-object to this workspace at (-200, -150);


    {Scenario 1: Invalid item, valid connection, valid vertices list}
    begin
        call g2-get-connection-vertices(the symbol fake, cc-up, vertices-list);
    end on error(err) 
        delete err;
        err-hap = true;
    end;
    if err-hap /= true then begin
        call fail(node, "Calling g2-get-connection-vertices with an invalid item should raise an error");
        return;
    end;

    {Scenario 2: valid item, invalid connection, valid vertices list}
    err-hap = false;
    begin
        call g2-get-connection-vertices(my-instance-block, the symbol fake, vertices-list);
    end on error(err) 
        delete err;
        err-hap = true;
    end;
    if err-hap /= true then begin
        call fail(node, "Calling g2-get-connection-vertices with an invalid connection should raise an error");
        return;
    end; 

    {Scenario 3: valid item, valid connection, invalid vertices list}
    err-hap = false;
    begin
        call g2-get-connection-vertices(my-instance-block, cc-up, the symbol fake);
    end on error(err) 
        delete err;
        err-hap = true;
    end;
    if err-hap /= true then begin
        call fail(node, "Calling g2-get-connection-vertices with an invalid vertices list should raise an error");
        return;
    end; 

    {Scenario 4: All params valid, but item not connected by connection}
    err-hap = false;
    begin
        call g2-get-connection-vertices(item-not-connected, cc-up, vertices-list);
    end on error(err) 
        delete err;
        err-hap = true;
    end;
    if err-hap /= true then begin
        call fail(node, "Calling g2-get-connection-vertices with an item that has no connection to it should raise an error");
        return;
    end;   

    {Scenario 5: all valid, connection with only one vertex}
    call g2-get-connection-vertices(one-list, cc-one-vertice, vertices-list);
    length = the number of elements in vertices-list;
    if length /= 1 then begin
        call fail(node, "Calling g2-get-connection-vertices on an item's connection with only one vortex returned [length]");
        return;
    end;
    if vertices-list[0] /= vertices-list-one-vertice[0]  then begin
        call fail(node, "Vertice received [vertices-list[0]], vertice expected [vertices-list-one-vertice[0]]");
        return;
    end;

    {Scenario 6: All valid, connection with two vertices}
    call g2-get-connection-vertices(one-list, cc-two-vertices, vertices-list);
    length = the number of elements in vertices-list;
    if length /= 2 then begin
        call fail(node, " Calling g2-get-connection-vertices on an item's connection with two vertices should return two vertices but returned [length]");
        return;
    end;

    for el = 0 to length - 1 do
        if vertices-list[el] /= vertices-list-two-vertices[el] then begin
            call fail(node, "Vertice received [vertices-list[el]], vertice expected [vertices-list-two-vertices[el]]");
            return;
        end;
    end;

    {Scenario 7: all valid, connection with several vertices, at least two different number of vertices. According to the new implementation of g2-get-connection-vertices, the integer list with the vertices returned contains the minimum number of vertices that the creation action requires. This number is typically one or two less than the total number of vertices in the original connection.}
    call g2-get-connection-vertices(my-instance-block, cc-up, vertices-list);
    length = the number of elements in vertices-list;
    length-ref = the number of elements in vertices-list-ref;
    if length <  length-ref - 2 and length > length-ref - 1 then begin
        call fail(node, " Calling g2-get-connection-vertices on an item's connection with [length-ref] vertices should return one or two vertices less, but returned [length]");
        return;
    end;
    for el = 0 to length - 1 do
        if vertices-list[el] /= vertices-list-ref[el] then begin
            call fail(node, "connection vertice received [vertices-list[el]], expected [vertices-list-ref[el]]");
            return;
        end;
    end;

    call g2-get-connection-vertices(my-instance-block, cc-down, vertices-list);
    length = the number of elements in vertices-list;
    length-ref = the number of elements in vertices-ccdown-list;
    if  length <  length-ref - 2 and length > length-ref - 1  then begin
        call fail(node, " Calling g2-get-connection-vertices on an item's connection with [length-ref] vertices should return one or two vertices less, but returned [length] ");
        return;
    end; 

    for el = 0 to length - 1 do
        if vertices-list[el] /= vertices-ccdown-list[el] then begin
            call fail(node, "Connection vertice received [vertices-list[el]], expected[vertices-ccdown-list[el]]");
            return;
        end;
    end;

    {Scenario 9: At least two different types of item that the queried connects to}
    call g2-get-connection-vertices (block1, con-diff, vertices-list);
    length = the number of elements in vertices-list;
    if length /= 2 then begin
        call fail(node, "Calling g2-get-connection-vertices on an item's connection which connects to another item should return 2 vertices, but returned [length]");
        return;
    end;

    call g2-get-connection-vertices (truth-var1, con-diff, vertices-list);
    length = the number of elements in vertices-list;
    if length /= 2 then begin
        call fail(node, "Calling g2-get-connection-vertices on an item's connection which connects to another item should return 2 vertices, but returned [length]");
        return;
    end;

    {Scenario 10: connection that connects "nowhere" (with a "loose" end) and kind of zig-zag}
    call g2-get-connection-vertices(my-instance-block, cc-up, vertices-list);
    length = the number of elements in vertices-list;
    if (length /= 3) or (vertices-list[0] /= vertices-list-ref[0]) or (vertices-list[1] /= vertices-list-ref[1]) then begin
        call fail(node, "Calling g2-get-connection-vertices on an item which has a loose zig zag connection (vertices 20, 30, 40, 50). It expects to return two vertices, returned [length]. Expected to return the first two vertices 20 and 30, returned [vertices-list[0]] and [vertices-list[1]]");
        return;
    end;

    {Scenario 11: Connections with vertices that go "zig-zag"}
    call g2-get-connection-vertices(one-list, zz-connection, vertices-list);
    length = the number of elements in vertices-list; 

    if length <= 2 or length > 6 then begin
        call fail(node, "Calling g2-get-connection-vertices with an item that has an out going connection in zig zag. Should return more than 2 vertices and less than 6 vertices, but returned [length] vertices");
        return;
    end;

    {Scenario 12: Connection to itself, both simple and "complex" (with several vertices, forming a "circle")}

    create a connection C of class my-connection connected between block-object locating it at right 25 and block-object locating it at left 25 with direction output, with vertices 35 60 -120;
    call g2-get-connection-vertices(block-object, C, vertices-list);
    length = the number of elements in vertices-list;
    if length /= 3 then begin
        call fail(node, "Calling g2-get-connection-vertices with self connected item should return 3 vertices, but returned [length]");
        return;
    end;

    call g2-get-connection-vertices(block-obj-instance-zz, zz-self-connection , vertices-list);
    length = the number of elements in vertices-list;
    if length /= 7 then begin
        call fail(node, "Calling g2-get-connection-vertices with self connected in zig-zag item should return 7 vertices, but returned [length]");
        return;
    end; 

    wait for 2 seconds;
    delete IL;
    delete item-not-connected;
    delete block-object; 

    call pass(node);
end
